// components/Input.js
import styled from "styled-components";

const Form = styled.form`
  max-width: 32rem;
  max-height: 100rem;
  margin: 0 auto;
  overflow: hidden;
  width: 100%;
  display: flex;
  flex-direction: column;
`;

export default Form;
